import React, { Fragment } from 'react';
import './registration.css';


const Registration = () => (
  <Fragment>
    <h1 className="title"><span>Начальная страница ETU_Bot</span></h1>
    <p>Здесь будет находиться основная информация о боте.</p>
  </Fragment>
);

export default Registration;
